class Solution {
    public int maxOperations(String s) {
        int ans = 0, cnt = 0;
        for(int i=0;i<s.length();i++){
            if(s.charAt(i)=='0') continue;
            if(i==s.length()-1) continue;
            cnt++;
            if(s.charAt(i+1)=='0'){
                ans += cnt;
                continue;
            }
        }
        return ans;
    }
}
